nse\":\"U\"},\"width\":1000,\"height\":225},\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"6e23f958-6d3c-406f-907c-70c2ccbf120e\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>4. Why do you think two conifer forests in Lebanon were turned into natural reserves? </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"16c42943-53b9-4d11-b238-1bb901c237ca\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>5. What is meant by environmental awareness?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"94877329-5518-4693-9198-afde4d7ea2f4\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Conifers in Lebanon\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Conifers in Lebanon\"},\"subContentId\":\"9891802a-10a1-4aab-b34e-63ab210a6906\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. Conifers are found along the Lebanese mountains.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"1158f4f0-b270-4212-aed8-7cf8e78e4759\"},{\"params\":{\"text\":\"<p>2. The cedar trees, the pine trees, and the cypress trees are examples of conifers found in the Lebanese mountains.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"a6cedd12-0a7a-48a9-95ba-5fae10d01ec0\"},{\"params\":{\"text\":\"<p>3. The cedar tree is displayed in the center of the Lebanese flag.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"693b36e7-4e08-405e-b3d6-b5fee166648d\"},{\"params\":{\"text\":\"<p>4. Two conifer forests in Lebanon were turned into natural reserves to protect them from extensive cutting and burning.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"db43d234-53f7-4f5d-b533-9c860851ec14\"},{\"params\":{\"text\":\"<p>5. Environmental awareness is being aware of the importance of protecting the natural world from harmful human actions. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"2a9885d1-41b7-4a8e-9229-ef7b28d64e08\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Check for your answers.\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Check for your answers.\"},\"subContentId\":\"e8222039-d795-4469-ba1f-0498ada711b0\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"a4ec28c5-ca2d-445b-9d80-fa2c2ddcfb8b\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Problem 2</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"me tentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"0092ffb0-a5dd-4229-96a0-e4a7cb410f33\"},{\"params\":{\"text\":\"<p>2. Harmful behaviors in the forest:</p>\\n\\n<p>Figure 1 shows kids lighting a bonfire in the middle of the forest. This fire could spread and burn many trees if not handled carefully.</p>\\n\\n<p>Figure 2 shows a man cutting excessively trees in the forest. Trees help to clean the air we breathe. Moreover, they are habitats for many animals. Therefore, cutting trees has a negative effect on the environment. </p>\\n\\n<p>Figure 3 shows kids throwing plastic bottles in the forest. Plastic is toxic to the soil, to trees, and to animals.</p>\\n\\n<p>On the other hand, Figure 4 represents a useful behavior to the environment since it shows kids planting trees.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"69437688-7fed-463e-8f0d-2da41484563d\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Check your answers\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Check your answers\"},\"subContentId\":\"f60bf7f9-54bf-44f6-b943-240034642b10\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"3ea71647-b752-4165-9470-ce1327ae2991\"},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.16","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"I solve complex problems","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"s
